        <Image src='/images/wireframe/media-paragraph.png' />
      </Grid.Column>
      <Grid.Column>
        <Image src='/images/wireframe/media-paragraph.png' />
      </Grid.Column>
    </Grid.Row>
  </Grid>
                </div>
                <div name="old-wod-layout"> 

                </div>
            </>
        );
    }
}

export default AthleteHompage;
